import React from 'react';
import './SessionNameInput.css';

class SaveSessionsPanel extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
        <form id="SessionNameInput" onSubmit={this.props.saveSession} className={this.props.visible ? 'visible' : null}>
            <input type="text" onChange={this.props.updateSessionName} value={this.props.sessionName} />
        </form>
        );
    }
}

export default SaveSessionsPanel;
